pragma solidity ^0.8.3;
import "@openzeppelin/contracts/token/ERC721/extensions/IERC721Metadata.sol";
import '@openzeppelin/contracts/token/ERC721/utils/ERC721Holder.sol';

contract TaskAssign is ERC721Holder{
  address assigner;


  constructor (address authPerson){
    assigner = authPerson;
  }
  struct Task {
    uint256 taskNumber;
    string desc;
    uint deadline;
    address[] to;
    uint256 idOfReward;
    string info; //a link to a doc explaining deets
  }
  Task [] public tasks;
  uint256 taskNo;
  mapping (uint256 => Task) public taskList;
  mapping (address => Task) public assignedTasks;
  mapping (address => mapping(uint256 => bool)) public statusOfReports;

  function assignTaskToOne (string memory descT, uint deadlineT, address toT, string memory infoT, uint256 NFTid) public returns(uint256){

    require(msg.sender == assigner, 'Person not assigned to create Tasks');
    address[] memory toArr = new address [](1);
    toArr[0]=toT;
    Task memory taskCreated = Task (
      taskNo,
      descT,
      deadlineT,
      toArr,
      NFTid,
      infoT
    );
    tasks.push(taskCreated);
    taskList[taskNo]= taskCreated;
    taskNo++;
    assignedTasks[toT]=taskCreated;
    statusOfReports[toT][taskNo]=false;
    return taskNo;
  }

  function assignTaskToSeveral(string memory descM, uint deadlineM, address[] calldata toM, string memory infoM, uint256 NFTid) public {
    Task memory taskCreated = Task (
      taskNo,
      descM,
      deadlineM,
      toM,
      NFTid,
      infoM
    );
    tasks.push(taskCreated);
    taskList[taskNo]= taskCreated;
    taskNo++;
    for (uint i =0;i<toM.length ; i++){
      assignedTasks[toM[i]]=taskCreated;
      statusOfReports [ toM[i] ] [taskNo]=false;
    }
  }

  function reportStatus (uint256 taskno) public {
    Task memory taskUsed = taskList[taskno];
    bool assigned = false;
    for (uint j= 0; j<taskUsed.to.length;j++){
      if (taskUsed.to[j]==msg.sender) {
        assigned= true;
      }
    }
    require(assigned == true , 'not your task');
    require(block.timestamp <= taskUsed.deadline, 'deadline passed');
    for (uint p=0;p<taskUsed.to.length;p++){
      statusOfReports[msg.sender][taskNo]=true;
    }
  }

  function transferRewardToOne (uint256 NftId, uint256 taskId, address rewardNFT) public {
    require(msg.sender == assigner);
    require(taskList[taskId].to.length == 1, 'more recipients');
    require(statusOfReports[msg.sender][taskId]== true, 'task not completed');
    address recep = taskList[taskId].to[0];

    IERC721(rewardNFT).transferFrom(address(this), recep, NftId);
  }

  function transferRewardToSeveral (uint256[] calldata NftIds, address[] calldata receps, uint256 taskId, address rewardNFT) public {
    require(msg.sender == assigner);
    require(taskList[taskId].to.length > 1, 'less recipients');
    for (uint k =0; k<receps.length; k++){
      require( statusOfReports[receps[k]][taskId] == true, 'task not completed');
      IERC721(rewardNFT).transferFrom(address(this),receps[k],NftIds[k]);
    }
  }

}
